package com.asthvinayak.operator;

public class OperatorDemo2 {
	
	
	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=5;
		int b=3;
		int c=4;
		int d=2;
		
		
		int e=a/b*c;
		System.out.println(e);
		
		
		int g=a+b*c-d*a/c%b;
		     // 5+12-10/4%3
		     // 5+12-2%3
		     // 5+12-2
		     // 17-2
		     //15
		    
		System.out.println(g);
		

	}

}
